import Feature from './Feature';
import styled from 'styled-components';
import { mediaQuery } from '../utils/style';

const layoutStyle = {
  //padding: 20,
  border: '1px solid #DDD',
  height: '350px',
};

const FeatureLayout = props => (
  <div>
    <div style={layoutStyle}>
      <Feature />
      {props.children}
    </div>
  </div>
);

export default FeatureLayout;
